        table is current as of the open of trading on December 23, 2024. An up-to-date
        list is available in the <a href=\"#External_links\">External links</a> section.</i>\n</p>\n<div
        class=\"mw-heading mw-heading3\"><h3 id=\"Historical_components\">Historical
        components</h3><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=15\" title=\"Edit
        section: Historical components\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>As
        of December 2024, 518 companies have been components of the index. Of these,
        only four, Apple, Costco (through its merger in 1993 with <a href=\"/wiki/Price_Club\"
        title=\"Price Club\">Price Club</a>, with Costco, as a separate entity, not
        becoming a component until at least 1989), Intel and PACCAR, have been components,
        continuously, since the first dissemination of the index in 1985. Two other
        current components, KLA Corporation and Micron Technology, were also components
        when the index started, but have been removed from the index over time for
        various reasons.<sup id=\"cite_ref-15\" class=\"reference\"><a href=\"#cite_note-15\"><span
        class=\"cite-bracket\">&#91;</span>15<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p>\n<div
        class=\"mw-heading mw-heading2\"><h2 id=\"Yearly_changes\">Yearly changes</h2><span
        class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=16\" title=\"Edit
        section: Yearly changes\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<div
        class=\"mw-heading mw-heading3\"><h3 id=\"Changes_from_2008\u20132011\"><span
        id=\"Changes_from_2008.E2.80.932011\"></span>Changes from 2008\u20132011</h3><span
        class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=17\" title=\"Edit
        section: Changes from 2008\u20132011\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p><a
        href=\"/wiki/DirecTV\" title=\"DirecTV\">DirecTV</a> replaced <a href=\"/wiki/BEA_Systems\"
        title=\"BEA Systems\">BEA Systems</a> on April 30, 2008<sup id=\"cite_ref-16\"
        class=\"reference\"><a href=\"#cite_note-16\"><span class=\"cite-bracket\">&#91;</span>16<span
        class=\"cite-bracket\">&#93;</span></a></sup> <a href=\"/wiki/CA_Technologies\"
        title=\"CA Technologies\">CA Technologies</a> replaced <a href=\"/wiki/Tellabs\"
        title=\"Tellabs\">Tellabs</a> on May 19, 2008.<sup id=\"cite_ref-17\" class=\"reference\"><a
        href=\"#cite_note-17\"><span class=\"cite-bracket\">&#91;</span>17<span class=\"cite-bracket\">&#93;</span></a></sup>
        <a href=\"/wiki/FLIR_Systems\" class=\"mw-redirect\" title=\"FLIR Systems\">FLIR
        Systems</a> replaced <a href=\"/wiki/UAL_Corporation\" title=\"UAL Corporation\">UAL
        Corporation</a> on July 21, 2008,<sup id=\"cite_ref-18\" class=\"reference\"><a
        href=\"#cite_note-18\"><span class=\"cite-bracket\">&#91;</span>18<span class=\"cite-bracket\">&#93;</span></a></sup>
        and on November 10, 2008 <a href=\"/wiki/Seagate_Technology\" title=\"Seagate
        Technology\">Seagate Technology</a> replaced <a href=\"/wiki/Monster_Worldwide\"
        title=\"Monster Worldwide\">Monster Worldwide</a>.<sup id=\"cite_ref-19\"
        class=\"reference\"><a href=\"#cite_note-19\"><span class=\"cite-bracket\">&#91;</span>19<span
        class=\"cite-bracket\">&#93;</span></a></sup> On December 22, 2008, Nasdaq
        added the following companies to the Nasdaq-100 index: <a href=\"/wiki/Automatic_Data_Processing\"
        class=\"mw-redirect\" title=\"Automatic Data Processing\">Automatic Data Processing</a>,
        <a href=\"/wiki/First_Solar\" title=\"First Solar\">First Solar</a>, <a href=\"/wiki/Life_Technologies_(Thermo_Fisher_Scientific)\"
        class=\"mw-redirect\" title=\"Life Technologies (Thermo Fisher Scientific)\">Life
        Technologies</a>, <a href=\"/wiki/Ross_Stores\" title=\"Ross Stores\">Ross
        Stores</a>, <a href=\"/wiki/Maxim_Integrated_Products\" class=\"mw-redirect\"
        title=\"Maxim Integrated Products\">Maxim Integrated Products</a>, <a href=\"/wiki/Illumina_(company)\"
        class=\"mw-redirect\" title=\"Illumina (company)\">Illumina</a>, <a href=\"/wiki/Pharmaceutical_Product_Development\"
        class=\"mw-redirect\" title=\"Pharmaceutical Product Development\">Pharmaceutical
        Product Development</a>, <a href=\"/wiki/O%27Reilly_Auto_Parts\" title=\"O&#39;Reilly
        Auto Parts\">O'Reilly Auto Parts</a>, <a href=\"/wiki/Urban_Outfitters\" title=\"Urban
        Outfitters\">Urban Outfitters</a>, <a href=\"/wiki/J._B._Hunt\" title=\"J.
        B. Hunt\">J. B. Hunt</a> and <a href=\"/wiki/Warner_Chilcott\" title=\"Warner
        Chilcott\">Warner Chilcott</a>, replacing <a href=\"/wiki/Amylin_Pharmaceuticals\"
        title=\"Amylin Pharmaceuticals\">Amylin Pharmaceuticals</a>, <a href=\"/wiki/Cadence_Design_Systems\"
        title=\"Cadence Design Systems\">Cadence Design Systems</a>, <a href=\"/wiki/Discovery_Communications\"
        class=\"mw-redirect\" title=\"Discovery Communications\">Discovery Communications</a>,
        <a href=\"/wiki/Lamar_Advertising_Company\" title=\"Lamar Advertising Company\">Lamar
        Advertising Company</a>, <a href=\"/wiki/Leap_Wireless_International\" class=\"mw-redirect\"
        title=\"Leap Wireless International\">Leap Wireless International</a>, <a
        href=\"/wiki/Level_3_Communications\" title=\"Level 3 Communications\">Level
        3 Communications</a>, <a href=\"/wiki/PetSmart\" title=\"PetSmart\">PetSmart</a>,
        <a href=\"/wiki/SanDisk\" title=\"SanDisk\">SanDisk</a>, <a href=\"/wiki/Sirius_XM_Radio\"
        class=\"mw-redirect\" title=\"Sirius XM Radio\">Sirius XM Radio</a>, <a href=\"/wiki/Virgin_Media\"
        title=\"Virgin Media\">Virgin Media</a> and <a href=\"/wiki/Whole_Foods_Market\"
        title=\"Whole Foods Market\">Whole Foods Market</a>.<sup id=\"cite_ref-20\"
        class=\"reference\"><a href=\"#cite_note-20\"><span class=\"cite-bracket\">&#91;</span>20<span
        class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p>On January 20, 2009,
        <a href=\"/wiki/News_Corporation\" title=\"News Corporation\">News Corporation</a>
        was added to the index, replacing <a href=\"/wiki/Focus_Media_Holding\" class=\"mw-redirect\"
        title=\"Focus Media Holding\">Focus Media Holding</a>, which did not meet
        the minimum monthly weight requirements.<sup id=\"cite_ref-21\" class=\"reference\"><a
        href=\"#cite_note-21\"><span class=\"cite-bracket\">&#91;</span>21<span class=\"cite-bracket\">&#93;</span></a></sup>
        On July 17, 2009, <a href=\"/wiki/Cerner\" class=\"mw-redirect\" title=\"Cerner\">Cerner</a>
        replaced <a href=\"/wiki/Sun_Microsystems\" title=\"Sun Microsystems\">Sun
        Microsystems</a> after Sun Microsystems was acquired by <a href=\"/wiki/Oracle_Corporation\"
        title=\"Oracle Corporation\">Oracle</a>. On October 29, 2009, <a href=\"/wiki/Priceline.com\"
        title=\"Priceline.com\">Priceline.com</a> replaced <a href=\"/wiki/Juniper_Networks\"
        title=\"Juniper Networks\">Juniper Networks</a> after Juniper transferred
        its listing to the NYSE.<sup id=\"cite_ref-22\" class=\"reference\"><a href=\"#cite_note-22\"><span
        class=\"cite-bracket\">&#91;</span>22<span class=\"cite-bracket\">&#93;</span></a></sup>
        On December 21, 2009, seven stocks joined the Nasdaq-100 index before the
        market open: <a href=\"/wiki/Vodafone\" title=\"Vodafone\">Vodafone</a>, <a
        href=\"/wiki/Mattel\" title=\"Mattel\">Mattel</a>, <a href=\"/wiki/BMC_Software\"
        title=\"BMC Software\">BMC Software</a>, <a href=\"/wiki/Mylan\" title=\"Mylan\">Mylan</a>,
        <a href=\"/wiki/Qiagen\" title=\"Qiagen\">Qiagen</a>, <a href=\"/wiki/SanDisk\"
        title=\"SanDisk\">SanDisk</a> and <a href=\"/wiki/Virgin_Media\" title=\"Virgin
        Media\">Virgin Media</a>. These stocks replaced <a href=\"/wiki/Akamai_Technologies\"
        title=\"Akamai Technologies\">Akamai Technologies</a>, <a href=\"/wiki/Hansen_Natural\"
        class=\"mw-redirect\" title=\"Hansen Natural\">Hansen Natural</a>, <a href=\"/wiki/IAC/InterActiveCorp\"
        class=\"mw-redirect\" title=\"IAC/InterActiveCorp\">IAC/InterActiveCorp</a>,
        <a href=\"/wiki/Liberty_Global\" title=\"Liberty Global\">Liberty Global</a>,
        <a href=\"/wiki/Pharmaceutical_Product_Development\" class=\"mw-redirect\"
        title=\"Pharmaceutical Product Development\">Pharmaceutical Product Development</a>,
        <a href=\"/wiki/Ryanair\" title=\"Ryanair\">Ryanair</a> and <a href=\"/wiki/Steel_Dynamics\"
        title=\"Steel Dynamics\">Steel Dynamics</a>.<sup id=\"cite_ref-23\" class=\"reference\"><a
        href=\"#cite_note-23\"><span class=\"cite-bracket\">&#91;</span>23<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p>On
        December 20, 2010, seven companies were added to the Nasdaq-100 index: <a
        href=\"/wiki/F5_Networks\" class=\"mw-redirect\" title=\"F5 Networks\">F5
        Networks</a>, <a href=\"/wiki/Akamai_Technologies\" title=\"Akamai Technologies\">Akamai
        Technologies</a>, <a href=\"/wiki/Netflix\" title=\"Netflix\">Netflix</a>,
        <a href=\"/wiki/Micron_Technology\" title=\"Micron Technology\">Micron Technology</a>,
        <a href=\"/wiki/Whole_Foods_Market\" title=\"Whole Foods Market\">Whole Foods
        Market</a>, <a href=\"/wiki/Ctrip\" class=\"mw-redirect\" title=\"Ctrip\">Ctrip</a>
        and <a href=\"/wiki/Dollar_Tree\" title=\"Dollar Tree\">Dollar Tree</a>, replacing
        <a href=\"/wiki/Cintas\" title=\"Cintas\">Cintas</a>, <a href=\"/wiki/Dish_Network\"
        title=\"Dish Network\">Dish Network</a>, <a href=\"/wiki/Foster_Wheeler\"
        title=\"Foster Wheeler\">Foster Wheeler</a>, <a href=\"/wiki/Hologic\" title=\"Hologic\">Hologic</a>,
        <a href=\"/wiki/J._B._Hunt\" title=\"J. B. Hunt\">J. B. Hunt</a>, <a href=\"/wiki/Logitech\"
        title=\"Logitech\">Logitech</a> and <a href=\"/wiki/Patterson_Companies\"
        title=\"Patterson Companies\">Patterson Companies</a>.<sup id=\"cite_ref-24\"
        class=\"reference\"><a href=\"#cite_note-24\"><span class=\"cite-bracket\">&#91;</span>24<span
        class=\"cite-bracket\">&#93;</span></a></sup> These were the only changes
        made to the index that year and the fewest since 1997.<sup class=\"noprint
        Inline-Template Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>\n</p><p>On
        April 4, 2011, <a href=\"/wiki/Alexion_Pharmaceuticals\" title=\"Alexion Pharmaceuticals\">Alexion
        Pharmaceuticals</a> replaced <a href=\"/wiki/Genzyme\" title=\"Genzyme\">Genzyme</a>
        before the market open.<sup id=\"cite_ref-25\" class=\"reference\"><a href=\"#cite_note-25\"><span
        class=\"cite-bracket\">&#91;</span>25<span class=\"cite-bracket\">&#93;</span></a></sup>
        On May 27, 2011, <a href=\"/wiki/Green_Mountain_Coffee_Roasters\" class=\"mw-redirect\"
        title=\"Green Mountain Coffee Roasters\">Green Mountain Coffee Roasters</a>
        replaced <a href=\"/wiki/Millicom_International_Cellular\" class=\"mw-redirect\"
        title=\"Millicom International Cellular\">Millicom International Cellular</a>
        after Millicom (MICC) withdrew its Nasdaq listing.<sup id=\"cite_ref-26\"
        class=\"reference\"><a href=\"#cite_note-26\"><span class=\"cite-bracket\">&#91;</span>26<span
        class=\"cite-bracket\">&#93;</span></a></sup> On July 15, 2011, <a href=\"/wiki/Sirius_XM_Radio\"
        class=\"mw-redirect\" title=\"Sirius XM Radio\">Sirius XM Radio</a> replaced
        <a href=\"/wiki/Cephalon\" title=\"Cephalon\">Cephalon</a> in the index,<sup
        id=\"cite_ref-27\" class=\"reference\"><a href=\"#cite_note-27\"><span class=\"cite-bracket\">&#91;</span>27<span
        class=\"cite-bracket\">&#93;</span></a></sup> and on December 6, 2011, <a
        href=\"/wiki/Perrigo\" title=\"Perrigo\">Perrigo</a> joined the index, replacing
        Joy Global, which transferred its listing to the NYSE.<sup id=\"cite_ref-28\"
        class=\"reference\"><a href=\"#cite_note-28\"><span class=\"cite-bracket\">&#91;</span>28<span
        class=\"cite-bracket\">&#93;</span></a></sup> Perrigo had been a member of
        the index in the 1990s, being dropped in 1996. On December 19, 2011, five
        companies joined the Nasdaq-100 index due to the annual reranking of the index:
        <a href=\"/wiki/Broadcom\" title=\"Broadcom\">Avago Technologies</a>, <a href=\"/wiki/Fossil_Group\"
        title=\"Fossil Group\">Fossil Group</a>, <a href=\"/wiki/Monster_Beverage\"
        title=\"Monster Beverage\">Monster Beverage</a>, <a href=\"/wiki/Nuance_Communications\"
        title=\"Nuance Communications\">Nuance Communications</a> and <a href=\"/wiki/Randgold_Resources\"
        title=\"Randgold Resources\">Randgold Resources</a>, replacing <a href=\"/wiki/FLIR_Systems\"
        class=\"mw-redirect\" title=\"FLIR Systems\">FLIR Systems</a>, <a href=\"/wiki/Illumina_(company)\"
        class=\"mw-redirect\" title=\"Illumina (company)\">Illumina</a>, <a href=\"/wiki/NII_Holdings\"
        title=\"NII Holdings\">NII Holdings</a>, <a href=\"/wiki/Qiagen\" title=\"Qiagen\">Qiagen</a>
        and <a href=\"/wiki/Urban_Outfitters\" title=\"Urban Outfitters\">Urban Outfitters</a>.<sup
        id=\"cite_ref-29\" class=\"reference\"><a href=\"#cite_note-29\"><span class=\"cite-bracket\">&#91;</span>29<span
        class=\"cite-bracket\">&#93;</span></a></sup>\n</p>\n<div class=\"mw-heading
        mw-heading3\"><h3 id=\"Changes_in_2012\">Changes in 2012</h3><span class=\"mw-editsection\"><span
        class=\"mw-editsection-bracket\">[</span><a href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=18\"
        title=\"Edit section: Changes in 2012\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>On
        April 23, 2012, <a href=\"/wiki/Texas_Instruments\" title=\"Texas Instruments\">Texas
        Instruments</a> replaced <a href=\"/wiki/First_Solar\" title=\"First Solar\">First
        Solar</a>. On May 30, 2012, <a href=\"/wiki/Viacom_(2005%E2%80%93present)\"
        class=\"mw-redirect\" title=\"Viacom (2005\u2013present)\">Viacom</a> became
        a component of the index, replacing <a href=\"/wiki/Teva_Pharmaceutical_Industries\"
        class=\"mw-redirect\" title=\"Teva Pharmaceutical Industries\">Teva Pharmaceutical
        Industries</a>, which transferred to the NYSE. On July 23, 2012, <a href=\"/wiki/Kraft_Foods\"
        title=\"Kraft Foods\">Kraft Foods</a>, now known as <a href=\"/wiki/Mondelez\"
        class=\"mw-redirect\" title=\"Mondelez\">Mondelez</a>, became a component
        of the index, replacing <a href=\"/wiki/Ctrip\" class=\"mw-redirect\" title=\"Ctrip\">Ctrip</a>.
        Kraft Foods was the fourth component of the Nasdaq-100 to also be included
        in the <a href=\"/wiki/Dow_Jones_Industrial_Average\" title=\"Dow Jones Industrial
        Average\">Dow Jones Industrial Average</a>, joining <a href=\"/wiki/Cisco\"
        title=\"Cisco\">Cisco</a>, Intel and Microsoft, but was removed from the DJIA
        when it subsequently split into two companies. On Wednesday December 12, 2012,
        <a href=\"/wiki/Meta_Platforms\" title=\"Meta Platforms\">Facebook, Inc</a>
        was added to the index, replacing <a href=\"/wiki/Infosys\" title=\"Infosys\">Infosys</a>,
        which transferred its listing to the <a href=\"/wiki/NYSE\" class=\"mw-redirect\"
        title=\"NYSE\">NYSE</a>. On December 24, 2012, 20 changes to the index took
        place. The ten companies joining the index were <a href=\"/wiki/Analog_Devices\"
        title=\"Analog Devices\">Analog Devices</a>, <a href=\"/wiki/Catamaran_Corporation\"
        title=\"Catamaran Corporation\">Catamaran Corporation</a>, <a href=\"/wiki/Discovery_Communications\"
        class=\"mw-redirect\" title=\"Discovery Communications\">Discovery Communications</a>,
        <a href=\"/wiki/Equinix\" title=\"Equinix\">Equinix</a>, <a href=\"/wiki/Liberty_Global\"
        title=\"Liberty Global\">Liberty Global</a>, <a href=\"/wiki/Liberty_Media\"
        title=\"Liberty Media\">Liberty Media</a>, <a href=\"/wiki/Regeneron_Pharmaceuticals\"
        title=\"Regeneron Pharmaceuticals\">Regeneron Pharmaceuticals</a>, <a href=\"/wiki/SBA_Communications\"
        title=\"SBA Communications\">SBA Communications</a>, <a href=\"/wiki/Verisk_Analytics\"
        title=\"Verisk Analytics\">Verisk Analytics</a> and <a href=\"/wiki/Western_Digital\"
        title=\"Western Digital\">Western Digital</a>. The ten companies being dropped
        were <a href=\"/wiki/Apollo_Group\" class=\"mw-redirect\" title=\"Apollo Group\">Apollo
        Group</a>, <a href=\"/wiki/Electronic_Arts\" title=\"Electronic Arts\">Electronic
        Arts</a>, <a href=\"/wiki/Flextronics\" class=\"mw-redirect\" title=\"Flextronics\">Flextronics</a>,
        <a href=\"/wiki/Green_Mountain_Coffee_Roasters\" class=\"mw-redirect\" title=\"Green
        Mountain Coffee Roasters\">Green Mountain Coffee Roasters</a>, <a href=\"/wiki/Lam_Research\"
        title=\"Lam Research\">Lam Research</a>, <a href=\"/wiki/Marvell_Technology_Group\"
        class=\"mw-redirect\" title=\"Marvell Technology Group\">Marvell Technology
        Group</a>, <a href=\"/wiki/Netflix\" title=\"Netflix\">Netflix</a>, <a href=\"/wiki/Research_in_Motion\"
        class=\"mw-redirect\" title=\"Research in Motion\">Research in Motion</a>,
        <a href=\"/wiki/VeriSign\" class=\"mw-redirect\" title=\"VeriSign\">VeriSign</a>
        and <a href=\"/wiki/Warner_Chilcott\" title=\"Warner Chilcott\">Warner Chilcott</a>.<sup
        id=\"cite_ref-30\" class=\"reference\"><a href=\"#cite_note-30\"><span class=\"cite-bracket\">&#91;</span>30<span
        class=\"cite-bracket\">&#93;</span></a></sup>\n</p>\n<div class=\"mw-heading
        mw-heading3\"><h3 id=\"Changes_in_2013\">Changes in 2013</h3><span class=\"mw-editsection\"><span
        class=\"mw-editsection-bracket\">[</span><a href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=19\"
        title=\"Edit section: Changes in 2013\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>On
        January 15, 2013, <a href=\"/wiki/Starz_Inc.\" title=\"Starz Inc.\">Starz</a>
        replaced <a href=\"/wiki/Liberty_Media\" title=\"Liberty Media\">Liberty Media</a>
        after a spinoff.<sup class=\"noprint Inline-Template Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a
        href=\"/wiki/Wikipedia:Citation_needed\" title=\"Wikipedia:Citation needed\"><span
        title=\"This claim needs references to reliable sources. (February 2018)\">citation
        needed</span></a></i>&#93;</sup> On March 18, 2013, <a href=\"/wiki/Kraft_Foods\"
        title=\"Kraft Foods\">Kraft Foods</a> replaced Starz.<sup id=\"cite_ref-31\"
        class=\"reference\"><a href=\"#cite_note-31\"><span class=\"cite-bracket\">&#91;</span>31<span
        class=\"cite-bracket\">&#93;</span></a></sup> On June 5, 2013, <a href=\"/wiki/Liberty_Media\"
        title=\"Liberty Media\">Liberty Media</a> replaced <a href=\"/wiki/Virgin_Media\"
        title=\"Virgin Media\">Virgin Media</a> after the companies merged. On June
        6, 2013, <a href=\"/wiki/Netflix\" title=\"Netflix\">Netflix</a> replaced
        <a href=\"/wiki/Perrigo\" title=\"Perrigo\">Perrigo</a>, which had transferred
        to the NYSE. On July 15, 2013, <a href=\"/wiki/Tesla_Inc\" class=\"mw-redirect\"
        title=\"Tesla Inc\">Tesla Motors</a> replaced <a href=\"/wiki/Oracle_Corporation\"
        title=\"Oracle Corporation\">Oracle</a>, which transferred to the NYSE. On
        July 25, <a href=\"/wiki/Charter_Communications\" title=\"Charter Communications\">Charter
        Communications</a> replaced <a href=\"/wiki/BMC_Software\" title=\"BMC Software\">BMC
        Software</a>.<sup id=\"cite_ref-32\" class=\"reference\"><a href=\"#cite_note-32\"><span
        class=\"cite-bracket\">&#91;</span>32<span class=\"cite-bracket\">&#93;</span></a></sup>
        On August 22, <a href=\"/wiki/Green_Mountain_Coffee_Roasters\" class=\"mw-redirect\"
        title=\"Green Mountain Coffee Roasters\">Green Mountain Coffee Roasters</a>
        returned to the index, replacing <a href=\"/wiki/Life_Technologies_(Thermo_Fisher_Scientific)\"
        class=\"mw-redirect\" title=\"Life Technologies (Thermo Fisher Scientific)\">Life
        Technologies</a>.<sup id=\"cite_ref-33\" class=\"reference\"><a href=\"#cite_note-33\"><span
        class=\"cite-bracket\">&#91;</span>33<span class=\"cite-bracket\">&#93;</span></a></sup>
        On October 29, <a href=\"/wiki/VEON\" title=\"VEON\">VimpelCom</a> replaced
        <a href=\"/wiki/Dell\" title=\"Dell\">Dell</a>. On November 18, <a href=\"/wiki/Marriott_International\"
        title=\"Marriott International\">Marriott International</a> was added to the
        index, replacing <a href=\"/wiki/Randgold_Resources\" title=\"Randgold Resources\">Randgold
        Resources</a>.<sup class=\"noprint Inline-Template Template-Fact\" style=\"white-space:nowrap;\">&#91;<i><a
        href=\"/wiki/Wikipedia:Citation_needed\" title=\"Wikipedia:Citation needed\"><span
        title=\"This claim needs references to reliable sources. (February 2018)\">citation
        needed</span></a></i>&#93;</sup> \n</p><p>On December 23, 2013, 10 changes
        to the index took place. The five companies joining the index were <a href=\"/wiki/DISH_Network_Corporation\"
        class=\"mw-redirect\" title=\"DISH Network Corporation\">DISH Network Corporation</a>,
        <a href=\"/wiki/Illumina_(company)\" class=\"mw-redirect\" title=\"Illumina
        (company)\">Illumina</a>, <a href=\"/wiki/NXP_Semiconductors\" title=\"NXP
        Semiconductors\">NXP Semiconductors</a>, <a href=\"/wiki/Tractor_Supply_Company\"
        title=\"Tractor Supply Company\">Tractor Supply Company</a> and <a href=\"/wiki/TripAdvisor\"
        class=\"mw-redirect\" title=\"TripAdvisor\">TripAdvisor</a>.<sup id=\"cite_ref-34\"
        class=\"reference\"><a href=\"#cite_note-34\"><span class=\"cite-bracket\">&#91;</span>34<span
        class=\"cite-bracket\">&#93;</span></a></sup> The five companies that were
        dropped were <a href=\"/wiki/Fossil_Group\" title=\"Fossil Group\">Fossil
        Group</a>, <a href=\"/wiki/Microchip_Technology\" title=\"Microchip Technology\">Microchip
        Technology</a>, <a href=\"/wiki/Nuance_Communications\" title=\"Nuance Communications\">Nuance
        Communications</a>, <a href=\"/wiki/Sears_Holdings\" title=\"Sears Holdings\">Sears
        Holdings</a> and <a href=\"/wiki/Dentsply\" class=\"mw-redirect\" title=\"Dentsply\">Dentsply</a>.\n</p>\n<div
        class=\"mw-heading mw-heading3\"><h3 id=\"Changes_in_2014\">Changes in 2014</h3><span
        class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=20\" title=\"Edit
        section: Changes in 2014\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>On
        April 3, 2014, the Class C common stock of <a href=\"/wiki/Google\" title=\"Google\">Google</a>
        was added to the index as a result of Google's stock split. This meant the
        index had 101 components. Later in 2014, additional classes of stock from
        other index companies were added to the index, bringing the number of constituent
        securities in the index to 107.<sup class=\"noprint Inline-Template Template-Fact\"
        style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>
        On December 12, 2014, Nasdaq announced that <a href=\"/wiki/American_Airlines_Group\"
        title=\"American Airlines Group\">American Airlines Group</a>, <a href=\"/wiki/Electronic_Arts\"
        title=\"Electronic Arts\">Electronic Arts</a> and <a href=\"/wiki/Lam_Research\"
        title=\"Lam Research\">Lam Research</a> would be added to the index, effective
        December 22, replacing <a href=\"/wiki/Expedia_Group\" title=\"Expedia Group\">Expedia
        Group</a>, <a href=\"/wiki/F5_Networks\" class=\"mw-redirect\" title=\"F5
        Networks\">F5 Networks</a> and <a href=\"/wiki/Maxim_Integrated_Products\"
        class=\"mw-redirect\" title=\"Maxim Integrated Products\">Maxim Integrated
        Products</a>.<sup id=\"cite_ref-35\" class=\"reference\"><a href=\"#cite_note-35\"><span
        class=\"cite-bracket\">&#91;</span>35<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p>\n<div
        class=\"mw-heading mw-heading3\"><h3 id=\"Changes_in_2015\">Changes in 2015</h3><span
        class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=21\" title=\"Edit
        section: Changes in 2015\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>On
        March 23, <a href=\"/wiki/Walgreens_Boots_Alliance\" title=\"Walgreens Boots
        Alliance\">Walgreens Boots Alliance</a> replaced <a href=\"/wiki/Equinix\"
        title=\"Equinix\">Equinix</a> in the index. Although it was still listed on
        NASDAQ, Equinix converted into a <a href=\"/wiki/Real_estate_investment_trust\"
        title=\"Real estate investment trust\">real estate investment trust</a>, making
        it ineligible for inclusion in the Nasdaq-100, but it did gain eligibility
        for the Nasdaq Financial-100.<sup id=\"cite_ref-36\" class=\"reference\"><a
        href=\"#cite_note-36\"><span class=\"cite-bracket\">&#91;</span>36<span class=\"cite-bracket\">&#93;</span></a></sup>
        On July 1, <a href=\"/wiki/Liberty_Interactive\" class=\"mw-redirect\" title=\"Liberty
        Interactive\">Liberty Interactive</a> created two new tracking stocks, tracking
        the company's interests in Latin America. Both tracking stocks were added
        to the index the same day.<sup class=\"noprint Inline-Template Template-Fact\"
        style=\"white-space:nowrap;\">&#91;<i><a href=\"/wiki/Wikipedia:Citation_needed\"
        title=\"Wikipedia:Citation needed\"><span title=\"This claim needs references
        to reliable sources. (February 2018)\">citation needed</span></a></i>&#93;</sup>
        On July 2, Kraft Foods merged with <a href=\"/wiki/Heinz\" title=\"Heinz\">Heinz</a>,
        becoming <a href=\"/wiki/Kraft_Heinz\" title=\"Kraft Heinz\">Kraft Heinz</a>.
        <a href=\"/wiki/Catamaran_Corporation\" title=\"Catamaran Corporation\">Catamaran
        Corporation</a> was removed from the index after the close of trading on July
        23, after going private. <a href=\"/wiki/JD.com\" title=\"JD.com\">JD.com</a>
        replaced it on July 29. <a href=\"/wiki/DirecTV\" title=\"DirecTV\">DirecTV</a>
        was removed from the index on July 24 due to its acquisition by <a href=\"/wiki/AT%26T\"
        title=\"AT&amp;T\">AT&amp;T</a> and replaced by <a href=\"/wiki/BioMarin_Pharmaceutical\"
        title=\"BioMarin Pharmaceutical\">BioMarin Pharmaceutical</a> on July 27.
        <a href=\"/wiki/Sigma-Aldrich\" title=\"Sigma-Aldrich\">Sigma-Aldrich</a>
        was removed on July 31, after being acquired by <a href=\"/wiki/Merck_KGaA\"
        class=\"mw-redirect\" title=\"Merck KGaA\">Merck KGaA</a>. <a href=\"/wiki/Skyworks_Solutions\"
        title=\"Skyworks Solutions\">Skyworks Solutions</a> replaced Sigma-Aldrich
        on August 3.<sup id=\"cite_ref-37\" class=\"reference\"><a href=\"#cite_note-37\"><span
        class=\"cite-bracket\">&#91;</span>37<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p><a
        href=\"/wiki/Altera\" title=\"Altera\">Altera</a> was removed on October 7
        as a result of its merger with Intel. <a href=\"/wiki/Incyte\" title=\"Incyte\">Incyte</a>
        replaced Altera's on that date.<sup id=\"cite_ref-38\" class=\"reference\"><a
        href=\"#cite_note-38\"><span class=\"cite-bracket\">&#91;</span>38<span class=\"cite-bracket\">&#93;</span></a></sup>
        <a href=\"/wiki/PayPal\" title=\"PayPal\">PayPal</a> was added to the index
        on November 11, as <a href=\"/wiki/Broadcom\" title=\"Broadcom\">Broadcom</a>
        was in the process of merging with Avago.<sup id=\"cite_ref-39\" class=\"reference\"><a
        href=\"#cite_note-39\"><span class=\"cite-bracket\">&#91;</span>39<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p>Nasdaq
        announced on December 11 that seven companies would be replaced in the index
        on December 21 due to annual re-ranking: <a href=\"/wiki/Ctrip\" class=\"mw-redirect\"
        title=\"Ctrip\">Ctrip</a>, <a href=\"/wiki/Endo_International\" title=\"Endo
        International\">Endo International</a>, <a href=\"/wiki/Expedia_Group\" title=\"Expedia
        Group\">Expedia Group</a>, <a href=\"/wiki/Maxim_Integrated_Products\" class=\"mw-redirect\"
        title=\"Maxim Integrated Products\">Maxim Integrated Products</a>, <a href=\"/wiki/Norwegian_Cruise_Line\"
        title=\"Norwegian Cruise Line\">Norwegian Cruise Line</a>, <a href=\"/wiki/T-Mobile_US\"
        title=\"T-Mobile US\">T-Mobile US</a> and <a href=\"/wiki/Ulta_Beauty\" title=\"Ulta
        Beauty\">Ulta Beauty</a>, replacing <a href=\"/wiki/C._H._Robinson_Worldwide\"
        class=\"mw-redirect\" title=\"C. H. Robinson Worldwide\">C. H. Robinson Worldwide</a>,
        <a href=\"/wiki/Expeditors_International\" title=\"Expeditors International\">Expeditors
        International</a>, <a href=\"/wiki/Garmin\" title=\"Garmin\">Garmin</a>, <a
        href=\"/wiki/Keurig_Green_Mountain\" class=\"mw-redirect\" title=\"Keurig
        Green Mountain\">Keurig Green Mountain</a>, <a href=\"/wiki/Staples_Inc\"
        class=\"mw-redirect\" title=\"Staples Inc\">Staples</a>, <a href=\"/wiki/VimpelCom\"
        class=\"mw-redirect\" title=\"VimpelCom\">VimpelCom</a> and <a href=\"/wiki/Wynn_Resorts\"
        title=\"Wynn Resorts\">Wynn Resorts</a>. Two Liberty Media (Liberty Global
        plc) tracking stocks (LILA) and (LILAK) were removed from the index, leaving
        106 separate components.<sup id=\"cite_ref-40\" class=\"reference\"><a href=\"#cite_note-40\"><span
        class=\"cite-bracket\">&#91;</span>40<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p>\n<div
        class=\"mw-heading mw-heading3\"><h3 id=\"Changes_in_2016\">Changes in 2016</h3><span
        class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=22\" title=\"Edit
        section: Changes in 2016\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>On
        February 1, Avago Technologies changed its name to <a href=\"/wiki/Broadcom\"
        title=\"Broadcom\">Broadcom</a>.<sup id=\"cite_ref-41\" class=\"reference\"><a
        href=\"#cite_note-41\"><span class=\"cite-bracket\">&#91;</span>41<span class=\"cite-bracket\">&#93;</span></a></sup>
        On February 22, <a href=\"/wiki/CSX_Corporation\" title=\"CSX Corporation\">CSX
        Corporation</a> replaced KLA-Tencor as a member of the index.<sup id=\"cite_ref-42\"
        class=\"reference\"><a href=\"#cite_note-42\"><span class=\"cite-bracket\">&#91;</span>42<span
        class=\"cite-bracket\">&#93;</span></a></sup> On March 16, <a href=\"/wiki/NetEase\"
        title=\"NetEase\">NetEase</a> replaced SanDisk as a member of the index.<sup
        id=\"cite_ref-43\" class=\"reference\"><a href=\"#cite_note-43\"><span class=\"cite-bracket\">&#91;</span>43<span
        class=\"cite-bracket\">&#93;</span></a></sup> On April 18, <a href=\"/wiki/Liberty_Media\"
        title=\"Liberty Media\">Liberty Media</a> established two tracking stocks
        (BATRA), (BATRK) to follow the performance of its investment in the <a href=\"/wiki/Atlanta_Braves\"
        title=\"Atlanta Braves\">Atlanta Braves</a>.<sup id=\"cite_ref-44\" class=\"reference\"><a
        href=\"#cite_note-44\"><span class=\"cite-bracket\">&#91;</span>44<span class=\"cite-bracket\">&#93;</span></a></sup>
        On June 20, <a href=\"/wiki/Dentsply_Sirona\" title=\"Dentsply Sirona\">Dentsply
        Sirona</a> returned to the index, replacing four Liberty Media tracking stocks
        (LMCA), (LMCK), (BATRA), (BATRK).<sup id=\"cite_ref-45\" class=\"reference\"><a
        href=\"#cite_note-45\"><span class=\"cite-bracket\">&#91;</span>45<span class=\"cite-bracket\">&#93;</span></a></sup>
        \n</p><p>On July 18, <a href=\"/wiki/Microchip_Technology\" title=\"Microchip
        Technology\">Microchip Technology</a> returned to the index, replacing Endo
        International.<sup id=\"cite_ref-46\" class=\"reference\"><a href=\"#cite_note-46\"><span
        class=\"cite-bracket\">&#91;</span>46<span class=\"cite-bracket\">&#93;</span></a></sup>
        On October 19, Shire PLC replaced <a href=\"/wiki/Linear_Technology\" title=\"Linear
        Technology\">Linear Technology</a> in the index.<sup id=\"cite_ref-47\" class=\"reference\"><a
        href=\"#cite_note-47\"><span class=\"cite-bracket\">&#91;</span>47<span class=\"cite-bracket\">&#93;</span></a></sup>
        On December 9, the annual re-ranking of the index was announced, resulting
        in four changes. Joining the index December 19 were <a href=\"/wiki/Cintas\"
        title=\"Cintas\">Cintas</a>, <a href=\"/wiki/Hasbro\" title=\"Hasbro\">Hasbro</a>,
        <a href=\"/wiki/Hologic\" title=\"Hologic\">Hologic</a> and <a href=\"/wiki/KLA-Tencor\"
        class=\"mw-redirect\" title=\"KLA-Tencor\">KLA-Tencor</a>. <a href=\"/wiki/Bed_Bath_%26_Beyond\"
        title=\"Bed Bath &amp; Beyond\">Bed Bath &amp; Beyond</a>, <a href=\"/wiki/NetApp\"
        title=\"NetApp\">NetApp</a>, <a href=\"/wiki/Stericycle\" title=\"Stericycle\">Stericycle</a>
        and <a href=\"/wiki/Whole_Foods_Market\" title=\"Whole Foods Market\">Whole
        Foods Market</a> were dropped from the index.<sup id=\"cite_ref-48\" class=\"reference\"><a
        href=\"#cite_note-48\"><span class=\"cite-bracket\">&#91;</span>48<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p>\n<div
        class=\"mw-heading mw-heading3\"><h3 id=\"Changes_in_2017\">Changes in 2017</h3><span
        class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=23\" title=\"Edit
        section: Changes in 2017\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>On
        February 1, Tesla Motors changed its corporate name to simply Tesla.<sup id=\"cite_ref-49\"
        class=\"reference\"><a href=\"#cite_note-49\"><span class=\"cite-bracket\">&#91;</span>49<span
        class=\"cite-bracket\">&#93;</span></a></sup> On February 7, <a href=\"/wiki/J._B._Hunt\"
        title=\"J. B. Hunt\">J. B. Hunt</a> replaced <a href=\"/wiki/NXP_Semiconductors\"
        title=\"NXP Semiconductors\">NXP Semiconductors</a> in the index.<sup id=\"cite_ref-50\"
        class=\"reference\"><a href=\"#cite_note-50\"><span class=\"cite-bracket\">&#91;</span>50<span
        class=\"cite-bracket\">&#93;</span></a></sup> On March 20, <a href=\"/wiki/Idexx_Laboratories\"
        title=\"Idexx Laboratories\">Idexx Laboratories</a> replaced <a href=\"/wiki/SBA_Communications\"
        title=\"SBA Communications\">SBA Communications</a> in the index after SBA
        converted to a REIT, rendering it ineligible for inclusion.<sup id=\"cite_ref-51\"
        class=\"reference\"><a href=\"#cite_note-51\"><span class=\"cite-bracket\">&#91;</span>51<span
        class=\"cite-bracket\">&#93;</span></a></sup> On April 24, <a href=\"/wiki/Wynn_Resorts\"
        title=\"Wynn Resorts\">Wynn Resorts</a> replaced <a href=\"/wiki/TripAdvisor\"
        class=\"mw-redirect\" title=\"TripAdvisor\">TripAdvisor</a>.<sup id=\"cite_ref-52\"
        class=\"reference\"><a href=\"#cite_note-52\"><span class=\"cite-bracket\">&#91;</span>52<span
        class=\"cite-bracket\">&#93;</span></a></sup> On June 19, <a href=\"/wiki/MercadoLibre\"
        class=\"mw-redirect\" title=\"MercadoLibre\">MercadoLibre</a> replaced <a
        href=\"/wiki/Yahoo!_Inc._(1995%E2%80%932017)\" title=\"Yahoo! Inc. (1995\u20132017)\">Yahoo!
        Inc</a> due to its acquisition by <a href=\"/wiki/Verizon\" title=\"Verizon\">Verizon</a>
        and subsequent conversion to a closed-end fund.<sup id=\"cite_ref-53\" class=\"reference\"><a
        href=\"#cite_note-53\"><span class=\"cite-bracket\">&#91;</span>53<span class=\"cite-bracket\">&#93;</span></a></sup>
        \n</p><p>On October 23, <a href=\"/wiki/Align_Technology\" title=\"Align Technology\">Align
        Technology</a> replaced <a href=\"/wiki/Mattel\" title=\"Mattel\">Mattel</a>
        in the index.<sup id=\"cite_ref-54\" class=\"reference\"><a href=\"#cite_note-54\"><span
        class=\"cite-bracket\">&#91;</span>54<span class=\"cite-bracket\">&#93;</span></a></sup>
        On December 8, Nasdaq announced that five companies would enter the index
        on December 18. They were <a href=\"/wiki/ASML_Holding\" title=\"ASML Holding\">ASML
        Holding</a>, <a href=\"/wiki/Cadence_Design_Systems\" title=\"Cadence Design
        Systems\">Cadence Design Systems</a>, <a href=\"/wiki/Synopsys\" title=\"Synopsys\">Synopsys</a>,
        <a href=\"/wiki/Take-Two_Interactive\" title=\"Take-Two Interactive\">Take-Two
        Interactive</a> and <a href=\"/wiki/Workday,_Inc\" class=\"mw-redirect\" title=\"Workday,
        Inc\">Workday</a> These companies replaced Akamai Technologies, Discovery
        Communications \u2013 both classes listed in the index (DISCA) (DISCK), Norwegian
        Cruise Lines, Tractor Supply and Viacom.<sup id=\"cite_ref-55\" class=\"reference\"><a
        href=\"#cite_note-55\"><span class=\"cite-bracket\">&#91;</span>55<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p>\n<div
        class=\"mw-heading mw-heading3\"><h3 id=\"Changes_in_2018\">Changes in 2018</h3><span
        class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=24\" title=\"Edit
        section: Changes in 2018\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>On
        July 23, <a href=\"/wiki/PepsiCo\" title=\"PepsiCo\">PepsiCo</a> replaced
        <a href=\"/wiki/Dish_Network\" title=\"Dish Network\">Dish Network</a>.<sup
        id=\"cite_ref-56\" class=\"reference\"><a href=\"#cite_note-56\"><span class=\"cite-bracket\">&#91;</span>56<span
        class=\"cite-bracket\">&#93;</span></a></sup> On November 5, <a href=\"/wiki/NXP_Semiconductors\"
        title=\"NXP Semiconductors\">NXP Semiconductors</a> rejoined the index following
        its failed acquisition by <a href=\"/wiki/Qualcomm\" title=\"Qualcomm\">Qualcomm</a>,
        replacing CA, which merged with Broadcom.<sup id=\"cite_ref-57\" class=\"reference\"><a
        href=\"#cite_note-57\"><span class=\"cite-bracket\">&#91;</span>57<span class=\"cite-bracket\">&#93;</span></a></sup>
        On November 19, <a href=\"/wiki/Xcel_Energy\" title=\"Xcel Energy\">Xcel Energy</a>
        replaced Dentsply Sirona.<sup id=\"cite_ref-58\" class=\"reference\"><a href=\"#cite_note-58\"><span
        class=\"cite-bracket\">&#91;</span>58<span class=\"cite-bracket\">&#93;</span></a></sup>
        On December 14, Nasdaq announced that 6 stocks will join the index on December
        24: <a href=\"/wiki/Advanced_Micro_Devices\" class=\"mw-redirect\" title=\"Advanced
        Micro Devices\">Advanced Micro Devices</a>, <a href=\"/wiki/Lululemon_Athletica\"
        class=\"mw-redirect\" title=\"Lululemon Athletica\">lululemon Athletica</a>,
        <a href=\"/wiki/NetApp\" title=\"NetApp\">NetApp</a>, <a href=\"/wiki/United_Airlines_Holdings\"
        title=\"United Airlines Holdings\">United Continental Holdings</a>, <a href=\"/wiki/Verisign\"
        title=\"Verisign\">Verisign</a> and <a href=\"/wiki/Willis_Towers_Watson\"
        title=\"Willis Towers Watson\">Willis Towers Watson</a>, replacing Express
        Scripts, Hologic, Qurate Retail Group, Seagate Technology, Shire and Vodafone.<sup
        id=\"cite_ref-59\" class=\"reference\"><a href=\"#cite_note-59\"><span class=\"cite-bracket\">&#91;</span>59<span
        class=\"cite-bracket\">&#93;</span></a></sup>\n</p>\n<div class=\"mw-heading
        mw-heading3\"><h3 id=\"Changes_in_2019\">Changes in 2019</h3><span class=\"mw-editsection\"><span
        class=\"mw-editsection-bracket\">[</span><a href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=25\"
        title=\"Edit section: Changes in 2019\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>On
        March 19, the two classes of stock of <a href=\"/wiki/Fox_Corporation\" title=\"Fox
        Corporation\">Fox Corporation</a> replaced the two classes of stock of <a
        href=\"/wiki/21st_Century_Fox\" title=\"21st Century Fox\">21st Century Fox</a>.
        On November 21, <a href=\"/wiki/Exelon\" title=\"Exelon\">Exelon</a> replaced
        <a href=\"/wiki/Celgene\" title=\"Celgene\">Celgene</a>.<sup id=\"cite_ref-60\"
        class=\"reference\"><a href=\"#cite_note-60\"><span class=\"cite-bracket\">&#91;</span>60<span
        class=\"cite-bracket\">&#93;</span></a></sup> On December 13, Nasdaq announced
        that as a result of the annual re-ranking of the index, six companies would
        join December 23: <a href=\"/wiki/Ansys\" title=\"Ansys\">Ansys</a>, <a href=\"/wiki/CDW\"
        title=\"CDW\">CDW</a>, <a href=\"/wiki/Copart\" title=\"Copart\">Copart</a>,
        <a href=\"/wiki/CoStar_Group\" title=\"CoStar Group\">CoStar Group</a>, <a
        href=\"/wiki/Seattle_Genetics\" class=\"mw-redirect\" title=\"Seattle Genetics\">Seattle
        Genetics</a> and <a href=\"/wiki/Splunk\" title=\"Splunk\">Splunk</a>, replacing
        <a href=\"/wiki/Hasbro\" title=\"Hasbro\">Hasbro</a>, <a href=\"/wiki/Henry_Schein\"
        title=\"Henry Schein\">Henry Schein</a>, <a href=\"/wiki/J.B._Hunt\" class=\"mw-redirect\"
        title=\"J.B. Hunt\">J.B. Hunt</a>, <a href=\"/wiki/Mylan\" title=\"Mylan\">Mylan</a>,
        <a href=\"/wiki/Gen_Digital\" title=\"Gen Digital\">NortonLifeLock</a> and
        <a href=\"/wiki/Wynn_Resorts\" title=\"Wynn Resorts\">Wynn Resorts</a>.<sup
        id=\"cite_ref-61\" class=\"reference\"><a href=\"#cite_note-61\"><span class=\"cite-bracket\">&#91;</span>61<span
        class=\"cite-bracket\">&#93;</span></a></sup>\n</p>\n<div class=\"mw-heading
        mw-heading3\"><h3 id=\"Changes_in_2020\">Changes in 2020</h3><span class=\"mw-editsection\"><span
        class=\"mw-editsection-bracket\">[</span><a href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=26\"
        title=\"Edit section: Changes in 2020\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>On
        April 20, <a href=\"/wiki/Dexcom\" title=\"Dexcom\">Dexcom</a> replaced <a
        href=\"/wiki/American_Airlines_Group\" title=\"American Airlines Group\">American
        Airlines Group</a> in the index,<sup id=\"cite_ref-62\" class=\"reference\"><a
        href=\"#cite_note-62\"><span class=\"cite-bracket\">&#91;</span>62<span class=\"cite-bracket\">&#93;</span></a></sup>
        and <a href=\"/wiki/Zoom_Video_Communications\" class=\"mw-redirect\" title=\"Zoom
        Video Communications\">Zoom Video Communications</a> replaced <a href=\"/wiki/Willis_Towers_Watson\"
        title=\"Willis Towers Watson\">Willis Towers Watson</a> on April 30.<sup id=\"cite_ref-63\"
        class=\"reference\"><a href=\"#cite_note-63\"><span class=\"cite-bracket\">&#91;</span>63<span
        class=\"cite-bracket\">&#93;</span></a></sup> On June 22, <a href=\"/wiki/DocuSign\"
        class=\"mw-redirect\" title=\"DocuSign\">DocuSign</a> replaced <a href=\"/wiki/United_Airlines_Holdings\"
        title=\"United Airlines Holdings\">United Airlines Holdings</a>,<sup id=\"cite_ref-64\"
        class=\"reference\"><a href=\"#cite_note-64\"><span class=\"cite-bracket\">&#91;</span>64<span
        class=\"cite-bracket\">&#93;</span></a></sup> and other replacements that
        year included <a href=\"/wiki/Moderna\" title=\"Moderna\">Moderna</a> replacing
        <a href=\"/wiki/CoStar_Group\" title=\"CoStar Group\">CoStar Group</a> on
        July 20,<sup id=\"cite_ref-65\" class=\"reference\"><a href=\"#cite_note-65\"><span
        class=\"cite-bracket\">&#91;</span>65<span class=\"cite-bracket\">&#93;</span></a></sup>
        <a href=\"/wiki/Pinduoduo\" title=\"Pinduoduo\">Pinduoduo</a> replacing <a
        href=\"/wiki/NetApp\" title=\"NetApp\">NetApp</a> on August 24,<sup id=\"cite_ref-66\"
        class=\"reference\"><a href=\"#cite_note-66\"><span class=\"cite-bracket\">&#91;</span>66<span
        class=\"cite-bracket\">&#93;</span></a></sup> and <a href=\"/wiki/Keurig_Dr_Pepper\"
        title=\"Keurig Dr Pepper\">Keurig Dr Pepper</a> replacing <a href=\"/wiki/Western_Digital\"
        title=\"Western Digital\">Western Digital</a> on October 19.<sup id=\"cite_ref-67\"
        class=\"reference\"><a href=\"#cite_note-67\"><span class=\"cite-bracket\">&#91;</span>67<span
        class=\"cite-bracket\">&#93;</span></a></sup> On December 21, six companies
        joined the index: <a href=\"/wiki/American_Electric_Power\" title=\"American
        Electric Power\">American Electric Power</a>, <a href=\"/wiki/Atlassian\"
        title=\"Atlassian\">Atlassian</a>, <a href=\"/wiki/Marvell_Technology_Group\"
        class=\"mw-redirect\" title=\"Marvell Technology Group\">Marvell Technology
        Group</a>, <a href=\"/wiki/Match_Group\" title=\"Match Group\">Match Group</a>,
        <a href=\"/wiki/Okta,_Inc.\" title=\"Okta, Inc.\">Okta</a> and <a href=\"/wiki/Peloton_Interactive\"
        title=\"Peloton Interactive\">Peloton Interactive</a>. They replaced <a href=\"/wiki/BioMarin_Pharmaceutical\"
        title=\"BioMarin Pharmaceutical\">BioMarin Pharmaceutical</a>, <a href=\"/wiki/Citrix_Systems\"
        title=\"Citrix Systems\">Citrix Systems</a>, <a href=\"/wiki/Expedia_Group\"
        title=\"Expedia Group\">Expedia Group</a>, <a href=\"/wiki/Liberty_Global\"
        title=\"Liberty Global\">Liberty Global</a> (both classes of shares), <a href=\"/wiki/Take-Two_Interactive\"
        title=\"Take-Two Interactive\">Take-Two Interactive</a> and <a href=\"/wiki/Ulta_Beauty\"
        title=\"Ulta Beauty\">Ulta Beauty</a>.<sup id=\"cite_ref-68\" class=\"reference\"><a
        href=\"#cite_note-68\"><span class=\"cite-bracket\">&#91;</span>68<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p>\n<div
        class=\"mw-heading mw-heading3\"><h3 id=\"Changes_in_2021\">Changes in 2021</h3><span
        class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=27\" title=\"Edit
        section: Changes in 2021\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>On
        July 21, <a href=\"/wiki/Honeywell\" title=\"Honeywell\">Honeywell</a> replaced
        <a href=\"/wiki/Alexion_Pharmaceuticals\" title=\"Alexion Pharmaceuticals\">Alexion
        Pharmaceuticals</a>, following its acquisition by <a href=\"/wiki/AstraZeneca\"
        title=\"AstraZeneca\">AstraZeneca</a>.<sup id=\"cite_ref-69\" class=\"reference\"><a
        href=\"#cite_note-69\"><span class=\"cite-bracket\">&#91;</span>69<span class=\"cite-bracket\">&#93;</span></a></sup>\nOn
        August 26, <a href=\"/wiki/Crowdstrike\" class=\"mw-redirect\" title=\"Crowdstrike\">Crowdstrike</a>
        replaced <a href=\"/wiki/Maxim_Integrated\" title=\"Maxim Integrated\">Maxim
        Integrated Products</a>, which was acquired by <a href=\"/wiki/Analog_Devices\"
        title=\"Analog Devices\">Analog Devices</a>.<sup id=\"cite_ref-70\" class=\"reference\"><a
        href=\"#cite_note-70\"><span class=\"cite-bracket\">&#91;</span>70<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p>On
        December 10, 2021, Nasdaq announced that six new companies would join the
        index prior to the market open on December 20, 2021. They are <a href=\"/wiki/Airbnb\"
        title=\"Airbnb\">Airbnb</a> (ABNB), <a href=\"/wiki/Datadog\" title=\"Datadog\">Datadog</a>
        (DDOG), <a href=\"/wiki/Fortinet\" title=\"Fortinet\">Fortinet</a> (FTNT),
        <a href=\"/wiki/Lucid_Motors\" title=\"Lucid Motors\">Lucid Group</a> (LCID),
        <a href=\"/wiki/Palo_Alto_Networks\" title=\"Palo Alto Networks\">Palo Alto
        Networks</a> (PANW), and <a href=\"/wiki/Zscaler\" title=\"Zscaler\">Zscaler</a>
        (ZS). They replaced CDW (CDW), Cerner (CERN), Check Point (CHKP), Fox Corporation
        (FOXA/FOX), Incyte (INCY), and Trip.com (TCOM).<sup id=\"cite_ref-71\" class=\"reference\"><a
        href=\"#cite_note-71\"><span class=\"cite-bracket\">&#91;</span>71<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p>\n<div
        class=\"mw-heading mw-heading3\"><h3 id=\"Changes_in_2022\">Changes in 2022</h3><span
        class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=28\" title=\"Edit
        section: Changes in 2022\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>On
        January 24, <a href=\"/wiki/Old_Dominion_Freight_Line\" title=\"Old Dominion
        Freight Line\">Old Dominion Freight Line</a> replaced <a href=\"/wiki/Peloton_Interactive\"
        title=\"Peloton Interactive\">Peloton</a>.<sup id=\"cite_ref-72\" class=\"reference\"><a
        href=\"#cite_note-72\"><span class=\"cite-bracket\">&#91;</span>72<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p>On
        February 2, <a href=\"/wiki/Constellation_Energy\" title=\"Constellation Energy\">Constellation
        Energy</a> was announced as being added to the index as of the end of the
        previous day. <a href=\"/wiki/Exelon\" title=\"Exelon\">Exelon</a>, from which
        Constellation was spun off, remained in the index; this increased the number
        of companies in the index to 101 and the number of stocks to 102 (because
        2 classes of Alphabet Inc. stock are in the index).<sup id=\"cite_ref-73\"
        class=\"reference\"><a href=\"#cite_note-73\"><span class=\"cite-bracket\">&#91;</span>73<span
        class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p>On February 22, <a href=\"/wiki/AstraZeneca\"
        title=\"AstraZeneca\">AstraZeneca</a> replaced <a href=\"/wiki/Xilinx\" title=\"Xilinx\">Xilinx</a>,
        which was being acquired by <a href=\"/wiki/Advanced_Micro_Devices\" class=\"mw-redirect\"
        title=\"Advanced Micro Devices\">AMD</a>.<sup id=\"cite_ref-74\" class=\"reference\"><a
        href=\"#cite_note-74\"><span class=\"cite-bracket\">&#91;</span>74<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p>On
        November 21, <a href=\"/wiki/Enphase_Energy\" title=\"Enphase Energy\">Enphase
        Energy</a> replaced <a href=\"/wiki/Okta_Inc.\" class=\"mw-redirect\" title=\"Okta
        Inc.\">Okta</a>.<sup id=\"cite_ref-75\" class=\"reference\"><a href=\"#cite_note-75\"><span
        class=\"cite-bracket\">&#91;</span>75<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p>On
        December 19, the annual re-ranking of the index took place prior to market
        open. The six stocks joining the index were <a href=\"/wiki/CoStar_Group\"
        title=\"CoStar Group\">CoStar Group</a>, <a href=\"/wiki/Rivian_Automotive\"
        class=\"mw-redirect\" title=\"Rivian Automotive\">Rivian Automotive</a>, <a
        href=\"/wiki/Warner_Bros._Discovery\" title=\"Warner Bros. Discovery\">Warner
        Bros. Discovery</a>, <a href=\"/wiki/GlobalFoundries\" title=\"GlobalFoundries\">GlobalFoundries</a>,
        <a href=\"/wiki/Baker_Hughes\" title=\"Baker Hughes\">Baker Hughes</a> and
        <a href=\"/wiki/Diamondback_Energy\" title=\"Diamondback Energy\">Diamondback
        Energy</a>. They replaced Baidu, DocuSign, Match Group, NetEase, Skyworks
        Solutions, Splunk, and Verisign. Dropping seven components allowed the Nasdaq-100
        index to once again have 100 companies.<sup id=\"cite_ref-76\" class=\"reference\"><a
        href=\"#cite_note-76\"><span class=\"cite-bracket\">&#91;</span>76<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p>\n<div
        class=\"mw-heading mw-heading3\"><h3 id=\"Changes_in_2023\">Changes in 2023</h3><span
        class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=29\" title=\"Edit
        section: Changes in 2023\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>On
        June 7, <a href=\"/wiki/GE_HealthCare\" title=\"GE HealthCare\">GE HealthCare</a>
        replaced <a href=\"/wiki/Fiserv\" title=\"Fiserv\">Fiserv</a> after Fiserv
        transferred to the NYSE.<sup id=\"cite_ref-77\" class=\"reference\"><a href=\"#cite_note-77\"><span
        class=\"cite-bracket\">&#91;</span>77<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p>On
        June 20, <a href=\"/wiki/Onsemi\" title=\"Onsemi\">Onsemi</a> replaced <a
        href=\"/wiki/Rivian\" title=\"Rivian\">Rivian</a>.<sup id=\"cite_ref-78\"
        class=\"reference\"><a href=\"#cite_note-78\"><span class=\"cite-bracket\">&#91;</span>78<span
        class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p>On July 17, <a href=\"/wiki/The_Trade_Desk\"
        title=\"The Trade Desk\">The Trade Desk</a> replaced <a href=\"/wiki/Activision_Blizzard\"
        title=\"Activision Blizzard\">Activision Blizzard</a>.<sup id=\"cite_ref-79\"
        class=\"reference\"><a href=\"#cite_note-79\"><span class=\"cite-bracket\">&#91;</span>79<span
        class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p>On December 18, as part
        of the annual re-ranking, <a href=\"/wiki/CDW\" title=\"CDW\">CDW</a>, <a
        href=\"/wiki/Coca-Cola_Europacific_Partners\" title=\"Coca-Cola Europacific
        Partners\">Coca-Cola Europacific Partners</a>, <a href=\"/wiki/DoorDash\"
        title=\"DoorDash\">DoorDash</a>, <a href=\"/wiki/MongoDB_Inc.\" title=\"MongoDB
        Inc.\">MongoDB</a>, <a href=\"/wiki/Roper_Technologies\" title=\"Roper Technologies\">Roper
        Technologies</a> and <a href=\"/wiki/Splunk\" title=\"Splunk\">Splunk</a>
        replaced Align Technologies, eBay, Enphase Energy, JD.com, Lucid Group and
        Zoom Video Communications.<sup id=\"cite_ref-80\" class=\"reference\"><a href=\"#cite_note-80\"><span
        class=\"cite-bracket\">&#91;</span>80<span class=\"cite-bracket\">&#93;</span></a></sup>
        Additionally, SeaGen was dropped after its merger with <a href=\"/wiki/Pfizer\"
        title=\"Pfizer\">Pfizer</a> was completed on December 14, and was replaced
        by <a href=\"/wiki/Take-Two_Interactive\" title=\"Take-Two Interactive\">Take-Two
        Interactive</a>. <sup id=\"cite_ref-81\" class=\"reference\"><a href=\"#cite_note-81\"><span
        class=\"cite-bracket\">&#91;</span>81<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p>\n<div
        class=\"mw-heading mw-heading3\"><h3 id=\"Changes_in_2024\">Changes in 2024</h3><span
        class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span><a
        href=\"/w/index.php?title=Nasdaq-100&amp;action=edit&amp;section=30\" title=\"Edit
        section: Changes in 2024\"><span>edit</span></a><span class=\"mw-editsection-bracket\">]</span></span></div>\n<p>On
        March 18, <a href=\"/wiki/Linde_plc\" title=\"Linde plc\">Linde</a> replaced
        <a href=\"/wiki/Splunk\" title=\"Splunk\">Splunk</a> after Cisco completed
        its acquisition of the company.<sup id=\"cite_ref-82\" class=\"reference\"><a
        href=\"#cite_note-82\"><span class=\"cite-bracket\">&#91;</span>82<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p>On
        June 24, <a href=\"/wiki/Arm_Holdings\" title=\"Arm Holdings\">Arm Holdings</a>
        replaced <a href=\"/wiki/Sirius_XM\" title=\"Sirius XM\">Sirius XM</a> as
        the company no longer met minimum weighting standards.<sup id=\"cite_ref-83\"
        class=\"reference\"><a href=\"#cite_note-83\"><span class=\"cite-bracket\">&#91;</span>83<span
        class=\"cite-bracket\">&#93;</span></a></sup><sup id=\"cite_ref-84\" class=\"reference\"><a
        href=\"#cite_note-84\"><span class=\"cite-bracket\">&#91;</span>84<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p>On
        July 22, <a href=\"/wiki/Supermicro\" title=\"Supermicro\">Supermicro</a>
        replaced <a href=\"/wiki/Walgreens_Boots_Alliance\" title=\"Walgreens Boots
        Alliance\">Walgreens Boots Alliance</a> as WBA no longer met minimum weighting
        standards.<sup id=\"cite_ref-85\" class=\"reference\"><a href=\"#cite_note-85\"><span
        class=\"cite-bracket\">&#91;</span>85<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p>On
        November 18, <a href=\"/wiki/AppLovin\" title=\"AppLovin\">AppLovin</a> replaced
        <a href=\"/wiki/Dollar_Tree\" title=\"Dollar Tree\">Dollar Tree</a> as Dollar
        Tree no longer met minimum weighting standards.<sup id=\"cite_ref-86\" class=\"reference\"><a
        href=\"#cite_note-86\"><span class=\"cite-bracket\">&#91;</span>86<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p><p>On
        December 13, as part of the annual reconstitution of the index, Nasdaq announced
        that three new companies would join the index prior to the market open on
        December 23, 2024. They are <a href=\"/wiki/Palantir_Technologies\" title=\"Palantir
        Technologies\">Palantir Technologies</a>, <a href=\"/wiki/MicroStrategy\"
        title=\"MicroStrategy\">MicroStrategy</a> and <a href=\"/wiki/Axon_Enterprise\"
        title=\"Axon Enterprise\">Axon Enterprise</a>. They replaced Illumina, Moderna,
        and Supermicro.<sup id=\"cite_ref-87\" class=\"reference\"><a href=\"#cite_note-87\"><span
        class=\"cite-bracket\">&#91;</span>87<span class=\"cite-bracket\">&#93;</span></a></sup>\n</p>\n<div
        class=\"mw-heading mw-heading2\"><h2 id=\"References\">References</h2><span
